import React from 'react';
import { Link } from 'react-router-dom';

function Footer() {
  return (
    <footer className="footer">
      <div className="container">
        <nav>
          <ul className="flex justify-center space-x-6">
            <li><Link to="/faq" className="hover:text-gray-500">FAQ</Link></li>
            <li><Link to="/terms" className="hover:text-gray-500">Terms of Service</Link></li>
            <li><Link to="/privacy" className="hover:text-gray-500">Privacy Policy</Link></li>
            <li><a href="mailto:support@directorymaker.com" className="hover:text-gray-500">Contact</a></li>
          </ul>
        </nav>
        <p className="text-center mt-4">&copy; {new Date().getFullYear()} Directory Maker. All rights reserved.</p>
      </div>
    </footer>
  );
}

export default Footer;
